import React from "react";
import { Container } from "@material-ui/core";

export default class Header extends React.Component {
  render() {
    return (
      <Container
        maxWidth="sm"
        fixed="true"
        style={{ display: "flex", justifyContent: "center" }}
      >
        <h1>todos</h1>
      </Container>
      // <header>
      // <h1>todos</h1>
      // </header>
    );
  }
}
